import React from 'react';
import { PostDetailsAdminStyled } from './PostDetailsAdmin.style';

const PostDetailsAdmin = ({
  title,
  description,
  imageUrl,
  content,
  postId,
}) => {
  return (
    <PostDetailsAdminStyled>
      <div>
        <label>_id: </label>
        <input type="text" value={postId} />
      </div>
      <div>
        <label>Title: </label>
        <input type="text" value={title} />
      </div>
      <div>
        <label>Description: </label>
        <input type="text" value={description} />
      </div>
      <div>
        <label>ImageUrl: </label>
        <input type="text" value={imageUrl} />
      </div>
      <div>
        <label>Contenu: </label>
        <input type="text" value={content} />
      </div>
    </PostDetailsAdminStyled>
  );
};

export { PostDetailsAdmin };
